import React, { Component } from "react";

class Heading extends Component {
  render() {
    render(
      <div style={{ textAlign: "center", marginBottom: "8%" }}>
        <h1>TOP TRACKS IN INDIA</h1>
      </div>
    );
  }
}

export default Heading;
